syntax = "proto3";

package iguazu.events.v1;

import "google/protobuf/timestamp.proto";
import "google/protobuf/wrappers.proto";

option go_package = "github.com/doordash/services-protobuf/generated/iguazu/events";
option java_multiple_files = true;
option java_package = "com.doordash.iguazu.events.v1";

// m_search_click_back_button - Fired when the Global Search Autocomplete back button was pressed
message MSearchClickBackbutton {
  // Derived from other mobile analytics protos
  google.protobuf.StringValue dd_session_id = 1;

  // Derived from other mobile analytics protos
  google.protobuf.StringValue target_app = 2;

  // Derived from other mobile analytics protos
  google.protobuf.StringValue dd_login_id = 3;

  // Derived from other mobile analytics protos
  google.protobuf.StringValue dd_device_id = 4;

  // Derived from other mobile analytics protos
  google.protobuf.StringValue component = 5;

  // Derived from other mobile analytics protos
  google.protobuf.StringValue is_rewrite = 6;

  // Derived from other mobile analytics protos
  google.protobuf.StringValue dd_ios_idfv_id = 7;

  // Derived from other mobile analytics protos
  google.protobuf.StringValue country_code = 8;

  // Query before pressing back button
  google.protobuf.StringValue query = 9;

  // Originating page
  google.protobuf.StringValue page = 10;

  // Derived from other mobile analytics protos
  google.protobuf.StringValue consumer_id = 11;

  // Derived from other mobile analytics protos
  google.protobuf.StringValue app_version = 12;

  // Length of a query
  google.protobuf.StringValue num_keystroke = 13;

