  google.protobuf.StringValue dd_delivery_correlation_id = 19;

  // Derived from other mobile analytics protos
  google.protobuf.StringValue dd_ios_idfa_id = 20;

  // Derived from other mobile analytics protos
  google.protobuf.StringValue dd_submarket_id = 21;

  // Derived from other mobile analytics protos
  google.protobuf.StringValue experience = 22;

  // Autocomplete session id before the event
  google.protobuf.StringValue autocomplete_id = 23;
}
